import { useState } from "react"
import "./Contact.css"


let Contact =()=>{

    let [name,setname] = useState("");
    let [mail,setmail] = useState(" ");
    let [num,setnum] = useState(" ");
    let sub;

    let submit =(event)=>{

        let name = setname(event.target.name);
        let mail = setmail(event.target.email);
        let num = setnum(event.target.mo);
        sub = 1;
        console.log(name,mail,num)
    }

    return(

    < div className="con">
        
      <div className="card">

        <div>
            <h2> CONTACT FORM</h2>
        </div>

        <div>
            <h3>{sub? `thank you ${name + mail + num}` : "Please fill form"}</h3>
        </div>

        <div>
            <label htmlFor="name">NAME:</label>
            <br/>
            <input type="text" name="name"></input>
        </div>

        <div>
            <label htmlFor="email">Email:</label>
            <br/>
            <input type="e-mail" name="email"></input>
        </div>

        <div>
            <label htmlFor="mo">Mo. Number:</label>
            <br/>
            <input type="tel" name="mo"></input>
        </div>

        <button onClick={submit}> SUBMIT </button>



      </div>
    
    </div>)
}

export default Contact;
